import React from "react";
import Logo from "../../assets/Nu Kenzie.png";
import Illustration from "../../assets/ilustrationMobile.png";
import "./style.css";
import { InitialButton } from "../Button";

export const HomePage = ({ setPage }) => {
  return (
    <main className="main__HomePage">
        <section className="main__section--elements">
          <img src={Logo} alt="logo" />
          <h1>Centralize o controle das suas finanças</h1>
          <p>de forma rápida e segura</p>
          <InitialButton setPage={setPage} />
        </section>
        <section className="i">
          <img src={Illustration} alt="ilustração-pagina-inicial" />
        </section>
    </main>
  );
};
